#
# TABLE STRUCTURE FOR: business_lines
#

DROP TABLE IF EXISTS `business_lines`;

CREATE TABLE `business_lines` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор сферы деятельности',
  `name` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название сферы деятельности',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Сферы дейтельности компаний';



#
# TABLE STRUCTURE FOR: companies
#

DROP TABLE IF EXISTS `companies`;

CREATE TABLE `companies` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор компании',
  `name` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название компании',
  `form` varchar(10) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Форма компании (ООО, ПАО и т.д.)',
  `inn` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'ИНН компании',
  `country` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Страна расположения компании',
  `city` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Город расположения компании',
  `address` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Адрес',
  `postcode` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Индекс компании',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Компании';



#
# TABLE STRUCTURE FOR: companies_business_lines
#

DROP TABLE IF EXISTS `companies_business_lines`;

CREATE TABLE `companies_business_lines` (
  `company_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на компанию',
  `business_line_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на сферу деятельности',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`company_id`,`business_line_id`) COMMENT 'Составной первичный ключ'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Связь между компаниями и сферами деятельности';



#
# TABLE STRUCTURE FOR: deal_statuses
#

DROP TABLE IF EXISTS `deal_statuses`;

CREATE TABLE `deal_statuses` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор статуса сделки',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название статуса',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Типы статусов сделок';



#
# TABLE STRUCTURE FOR: deals
#

DROP TABLE IF EXISTS `deals`;

CREATE TABLE `deals` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор сделки',
  `company_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на компанию',
  `company_status_in_deal` enum('PROVIDER','RECIPIENT') COLLATE utf8_unicode_ci NOT NULL COMMENT 'Статус компании в сделке - поставщик или получатель',
  `request_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на запрос',
  `offer_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на предложение',
  `price` decimal(10,0) NOT NULL COMMENT 'Цена за услугу или товар в сделке',
  `delivery_method_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на способ доставки',
  `delivery_term` int(10) unsigned DEFAULT NULL COMMENT 'Срок выполнения',
  `status_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на статус сделки',
  `complete_date` datetime DEFAULT NULL COMMENT 'Дата завершения сделки (даже если она откланена)',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Сделки';



#
# TABLE STRUCTURE FOR: delivery_methods
#

DROP TABLE IF EXISTS `delivery_methods`;

CREATE TABLE `delivery_methods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название способа доставки',
  `company_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на компанию, которая добавила способ доставки',
  `status` tinyint(1) DEFAULT NULL COMMENT 'Статус метода доставки, активен или нет',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Способы доставки компаний';



#
# TABLE STRUCTURE FOR: file_types
#

DROP TABLE IF EXISTS `file_types`;

CREATE TABLE `file_types` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор типа файла',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название типа',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Типы файлов';



#
# TABLE STRUCTURE FOR: files
#

DROP TABLE IF EXISTS `files`;

CREATE TABLE `files` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор файла',
  `company_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на компанию, пользователь которой загрузил файл',
  `file_path` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Путь к файлу',
  `file_size` int(11) NOT NULL COMMENT 'Размер файла',
  `metadata` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Метаданные файла' CHECK (json_valid(`metadata`)),
  `file_type_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на тип файла',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Файлы';



#
# TABLE STRUCTURE FOR: offers
#

DROP TABLE IF EXISTS `offers`;

CREATE TABLE `offers` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `company_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на компанию-инициатора предложения',
  `summary` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Заголовок предложения',
  `description` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание предложения',
  `price` decimal(10,0) NOT NULL COMMENT 'Цена за услугу или товар в предложении',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT 'Статус - опубликовано или нет',
  `product_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на товар',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Предложения';



#
# TABLE STRUCTURE FOR: offers_files
#

DROP TABLE IF EXISTS `offers_files`;

CREATE TABLE `offers_files` (
  `offer_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на предложение',
  `file_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на файл',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`offer_id`,`file_id`) COMMENT 'Составной первичный ключ'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Связь между предложениями и прикрепленными файлами';



#
# TABLE STRUCTURE FOR: products
#

DROP TABLE IF EXISTS `products`;

CREATE TABLE `products` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор товара',
  `category_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на категорию товара',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название товара',
  `description` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание товара',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Товары';



#
# TABLE STRUCTURE FOR: products_categories
#

DROP TABLE IF EXISTS `products_categories`;

CREATE TABLE `products_categories` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор категории товара',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название категории товара',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Категории товара';



#
# TABLE STRUCTURE FOR: products_files
#

DROP TABLE IF EXISTS `products_files`;

CREATE TABLE `products_files` (
  `product_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на товар',
  `file_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на файл',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`product_id`,`file_id`) COMMENT 'Составной первичный ключ'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Связь между товарами и прикрепленными файлами';



#
# TABLE STRUCTURE FOR: requests
#

DROP TABLE IF EXISTS `requests`;

CREATE TABLE `requests` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `company_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на компанию-инициатора запроса',
  `summary` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Заголовок запроса',
  `description` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание запроса',
  `price` decimal(10,0) NOT NULL COMMENT 'Цена за услугу или товар в запросе',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT 'Статус - опубликовано или нет',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Запросы';



#
# TABLE STRUCTURE FOR: requests_files
#

DROP TABLE IF EXISTS `requests_files`;

CREATE TABLE `requests_files` (
  `request_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на запрос',
  `file_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на файл',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`request_id`,`file_id`) COMMENT 'Составной первичный ключ'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Связь между запросами и прикрепленными файлами';



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор пользовтеля',
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Имя пользователя',
  `last_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Фамилия пользователя',
  `middle_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Отчество',
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Телефон',
  `company_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на компанию',
  `passwd` varchar(256) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Пароль пользователя',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Пользователи';





